"<div>\n<i class=\"NoteType\">\nNotatka o osobie\n</i>\n<div class=\"grampsstylednote\">\n<p>\nKandydatka:<br />\n1828\t139\tMarianna\tSakowska\tPiotr\tAnastazja\tSitkowska\tPu\u0142tusk\tPonikiew\n</p>\n</div>\n<i class=\"NoteType\">\nNotatka o osobie\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMarianna Sakowska ZG<br />\n15  - Nov 1899<br />\nZjawi\u0142 si\u0119 Aleksander Ptaszy\u0144ski 60 - Micha\u0142 Bartoszewski 70, z Perek<br />\n14-11-1899 o 5tej rano umar\u0142a w Perkach - Marianna Sakowska, 73 lata\n</p>\n<p>\nFilipa i Katarzyny <br />\nurodzi\u0142/a si\u0119\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n \u0440\u043e\u0434\u0443\u0432\u0448\u0443\u043e\u0441\u044f  \u0432\u0438 \u0423\u0435\u043e\u043d\u043e\u0432\u044a/\u0416\u0430\u043d\u043e\u0432\u044a \u043f\u0440\u0438\u0445\u043e\u0434\u0430 \u0411\u0440\u043e\u0445\u043e\u0432\u044c \u0412\u0430\u0440\u0448\u0430\u0432\u0441\u043a\u0438\u0445\u044a \u0433\u0443\u0431\u0435\u0440\u043d\u0438\u0438 \u0436\u0438\u0441\u0430\u0435\u043b\u044c \u0432\u043e\u0432\u0430\u0432\u0435\u0441\u0435\u043d\u0430\u044f \u0438\u0440\u0438 \u043f\u043e \u0434\u0435\u0448\u0432\u0435\u0448\u0438\u043d\u0441\u0430\u0445\u0433\u0435 \u043c\u043e\u0440\u0433\u043e\u0432\u0448\u0438\u0441\u0430\u0445\u044a \u0431 \u041f\u0435\u0440\u043a\u0430\u0445\u044a<br />\n\"\u0440\u043e\u0434\u0438\u0432\u0448\u0435\u0433\u043e\u0441\u044f \u0432  /\u0423\u0435\u043d\u043e\u0432\u044a/\u0416\u0430\u043d\u043e\u0432\u044a  \u043f\u0440\u0438\u0445\u043e\u0434\u0430 \u0411\u0440\u043e\u0445\u043e\u0432\u044a \u0412\u0430\u0440\u0448\u0430\u0432\u0441\u043a\u0438\u0445\u044a \u0433\u0443\u0431\u0435\u0440\u043d\u0438\u0438 \u0436\u0438\u0442\u0435\u043b\u044f  \u0432\u043e\u0432\u0430\u0432\u0435\u0441\u0435\u043d\u0430\u044f \u0438\u043b\u0438 \u043f\u043e \u0434\u0435\u0448\u0432\u0435\u0448\u0438\u043d\u0441\u0430\u0445\u0433\u0435 \u043c\u043e\u0433\u0432\u0435\u0448\u0438\u0441\u0430\u0445\u044a \u0432 \u041f\u0435\u0440\u043a\u0430\u0445\u044a.\"\n</p>\n<p>\nPrzet\u0142umaczenie na j\u0119zyk polski:\n</p>\n<p>\n\"urodzonego w parafii Jan\u00f3w/Uenov/\u017banov, w Broch\u00f3w, guberni warszawskiej, zamieszka\u0142ego w wiosce Wawesina lub w okolicach Morgowiszysz w Perkach.\"\n</p>\n</div>\n</div>",
